RecipeCount = tablelength(CraftableItems) -- Used to be Recipes... 
Quantity = 1
OreCost = {}
IsSelectedCraftable = false


function getIndexForRecipe(name)
	for k,v in pairs(Recipes) do
		if v.name == name then
			return k
		end
	end
	return -1
end

-- And now the hard part.
-- Go through every input, if it's Type isn't ore, go through all of those inputs, ad infinatum until we just have all the ores
function getOreCosts(index, quantity)
	-- Recursive func.  Checks all of its inputs, gets the indices, checks their type
	-- If the type isn't an ore, calls this to get the ores out of that recipe
	
	-- Should return a matrix of name:number for ores
	-- Will need to add the values to the matrix if that name already exists
	local cost = {}
	-- Note that inputs is also in format of name:number
	for k,v in pairs(Recipes[index].input) do
		local curIndex = getIndexForRecipe(v.name)
		local curRecipe = Recipes[curIndex]
		-- So let's say Steel needs 50 Carbon Pure and makes 75 Steel
		-- How much Carbon Pure do I need for 1 steel?
		-- That's easy, 50/75
		if curRecipe.type == "Ore" or curRecipe.name == "Oxygen Pure" or curRecipe.name == "Hydrogen Pure" then
			if cost[v.name] ~= nil then -- Is this good enough?
				cost[v.name] = cost[v.name] + (v.amount/Recipes[index].outputQuantity)*quantity
			else
				cost[v.name] = (v.amount/Recipes[index].outputQuantity)*quantity
			end
		else
			-- Not an ore, get the ores out of it
			-- Again v.amount is how many we need of curRecipe for one of these Recipes[index]
			
			local innerOres = getOreCosts(curIndex, (v.amount/Recipes[index].outputQuantity)*quantity)
			for key,val in pairs(innerOres) do
				if cost[key] ~= nil then -- Is this good enough?
					cost[key] = cost[key] + val
				else
					cost[key] = val -- quantity is already accounted for in these
				end
			end
		end
	end
	return cost
end